$(function(){
        var top_show = 280;
        var speed = 500;
    	var $backButton = $('#up'), footerposition;
        
        
    	$(document).scroll(function () {
    		if ($(this).scrollTop() > top_show && $(this).scrollTop() < $(document).height() - $(window).height()-60) {
    			$backButton.fadeIn();
    		}
    		else {
    			$backButton.fadeOut();
    		}
    	});
    	$backButton.click(function () {
    		scrollto(0, speed);
    	});
    	
    	window.scrollto = function(destination, speed) {
    		if (typeof speed == 'undefined') {
    			speed = 800;
    		}
    		jQuery("html:not(:animated),body:not(:animated)").animate({scrollTop: destination-60}, speed);
    	};
    	$("a.scrollto").click(function () {
    		var elementClick = $(this).attr("href")
    		var destination = $(elementClick).offset().top;
    		scrollto(destination);
    		return false;
    	});
    	
    	
        $('.fancybox').fancybox({
            padding: 0,
            openEffect  : 'none',
            closeEffect : 'none',
            nextEffect  : 'none',
            prevEffect  : 'none',
            helpers: {
            overlay: {
              locked: false
            }
            }
        });
        
        $('.fancyboxModal').fancybox({
            padding: 0,
            openEffect  : 'none',
            closeEffect : 'none',
            nextEffect  : 'none',
            prevEffect  : 'none',
            fitToView : false, 
            maxWidth: '100%',
            scrolling : "no",
            helpers: {
            overlay: {
              locked: false
            }
            }
        });
        
            
        $('.top-slider').on('init', function(e, slick) {
            var $firstAnimatingElements = $('.item:first-child').find('[data-animation]');
            doAnimations($firstAnimatingElements);    
        });
        $('.top-slider').on('beforeChange', function(e, slick, currentSlide, nextSlide) {
            var $animatingElements = $('.item[data-slick-index="' + nextSlide + '"]').find('[data-animation]');
            doAnimations($animatingElements);    
        });
        $('.top-slider').slick({
            infinite: true,
            autoplay: true,
            autoplaySpeed: 5000,
            speed: 2000,
            dots: true,
            fade: true,
            prevArrow: '<a href="#" class="slick-prev"><i class="material-icons">navigate_before</i></a>',
            nextArrow: '<a href="#" class="slick-next"><i class="material-icons">navigate_next</i></a>',
            responsive: [
                {
                    breakpoint: 1350,
                    settings: {
                        arrows: false,
                        dots: true
                    }
                }
            ]   
        });
        function doAnimations(elements) {
            var animationEndEvents = 'webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend';
            elements.each(function() {
                var $this = $(this);
                var $animationDelay = $this.data('delay');
                var $animationType = 'animated ' + $this.data('animation');
                $this.css({
                    'animation-delay': $animationDelay,
                    '-webkit-animation-delay': $animationDelay
                });
                $this.addClass($animationType).one(animationEndEvents, function() {
                    $this.removeClass($animationType);
                });
            });
        }
        
        
        $('.partners-carousel').slick({
            infinite: true,
            slidesToShow: 6,
            slidesToScroll: 1,
            autoplay: true,
            autoplaySpeed: 6000,
            speed: 500,
            dots: false,
            swipeToSlide: true,
            prevArrow: '<a href="#" class="slick-prev"><i class="material-icons">navigate_before</i></a>',
            nextArrow: '<a href="#" class="slick-next"><i class="material-icons">navigate_next</i></a>',
            responsive: [
            {
              breakpoint: 1350,
              settings: {
                arrows: false,
                slidesToShow: 5
              }
            },
            {
              breakpoint: 992,
              settings: {
                arrows: false,
                slidesToShow: 4
              }
            },
            {
              breakpoint: 700,
              settings: {
                arrows: false,
                slidesToShow: 3
              }
            },
            {
              breakpoint: 460,
              settings: {
                arrows: false,
                slidesToShow: 2
              }
            }
          ]   
        });
        
        
        $('.rev-carousel').slick({
            infinite: false,
            dots: true,
            slidesToShow: 2,
            slidesToScroll: 1,
            autoplay: false,
            autoplaySpeed: 6000,
            speed: 500,
            arrows: false,
            responsive: [
                {
                  breakpoint: 600,
                  settings: {
                    slidesToShow: 1
                  }
                }
            ]   
        }).on('setPosition', function (event, slick) {
            $(this).find('.slick-slide').height('auto');
            $(this).find('.element-body').height('auto');
        });
        
        
        
        $('.team-carousel').slick({
            infinite: true,
            slidesToShow: 6,
            slidesToScroll: 1,
            autoplay: true,
            autoplaySpeed: 6000,
            speed: 500,
            dots: false,
            swipeToSlide: true,
            prevArrow: '<a href="#" class="slick-prev"><i class="material-icons">navigate_before</i></a>',
            nextArrow: '<a href="#" class="slick-next"><i class="material-icons">navigate_next</i></a>',
            responsive: [
            {
              breakpoint: 1350,
              settings: {
                arrows: false,
                slidesToShow: 5
              }
            },
            {
              breakpoint: 992,
              settings: {
                arrows: false,
                slidesToShow: 4
              }
            },
            {
              breakpoint: 700,
              settings: {
                arrows: false,
                slidesToShow: 3
              }
            },
            {
              breakpoint: 460,
              settings: {
                arrows: false,
                slidesToShow: 2
              }
            }
          ]   
        });
        
        
        
        
        $('.rf').each(function(){
            var item = $(this),
            btn = item.find('.btn');
            function checkInput(){
                item.find('select.required').each(function(){
                    if($(this).val() == '0'){
                        $(this).parents('.form-group').addClass('error');
                        $(this).parents('.form-group').find('.error-message').show();

                    } else {
                        $(this).parents('.form-group').removeClass('error');
                    }
                });
                
                
                item.find('input[type=text].required').each(function(){
                    if($(this).val() != ''){
                        $(this).removeClass('error');
                    } else {
                        $(this).addClass('error');
                        $(this).parent('.form-group').find('.error-message').show();
                        
                    }
                });
                
                
                item.find('textarea.required').each(function(){
                    if($(this).val() != ''){
                        $(this).removeClass('error');
                    } else {
                        $(this).addClass('error');
                        $(this).parent('.form-group').find('.error-message').show();
                        
                    }
                });
                
                item.find('input[type=email]').each(function(){
                    var regexp = /^([a-z0-9_-]+\.)*[a-z0-9_-]+@[a-z0-9_-]+(\.[a-z0-9_-]+)*\.[a-z]{2,6}$/i;
                    var $this = $(this);
                    if($this.hasClass('required')){
                        
                        if (regexp.test($this.val())) {
                            $this.removeClass('error');
                        }else {
                            $this.addClass('error');
                            $(this).parent('.form-group').find('.error-message').show();
                        }
                    }else{
                        
                        if($this.val() != ''){
                            if (regexp.test($this.val())) {
                                $this.removeClass('error');
                            }else {
                            
                            $this.addClass('error');
                            $(this).parent('.form-group').find('.error-message').show();
                            }
                        }else{
                            $this.removeClass('error');
                        }
                    }
                    
                });
                
                
                item.find('input[type=checkbox].required').each(function(){
                    if($(this).is(':checked')){
                        $(this).removeClass('error');
                    } else {
                        $(this).addClass('error');
                        $(this).parent('.form-group').find('.error-message').show();
                    }
                });
                
            
            }

            btn.click(function(){
                checkInput();
                var sizeEmpty = item.find('.error:visible').length;
                if(sizeEmpty > 0){
                    return false;
                } else {
                    item.submit();
                    $.fancybox.close();
                }
            });

        });
        
        
        $('.required').change(function(){
            if($(this).val() != ''){
                $(this).removeClass('error');
                $(this).parents('.form-group').find('.error-message').hide();
            }
            
        });
        
        $('select').change(function(){
            if($(this).val() == ''){     
                $(this).parents('.form-group').removeClass('selected');
            } else {
                $(this).parents('.form-group').addClass('selected');
                $(this).parents('.form-group').removeClass('error');
            }
        });
        
        
        
        var isIE = /*@cc_on!@*/false || !!document.documentMode;
            
        if(isIE){
            $('body').addClass('ie');
        }
        
        $('.menu-button').click(function(){
            $('.menu-button').toggleClass('active');
            $('.mobile-menu').toggleClass('open');
        });
        $('.mobile-menu, .menu-button').click(function(e){
            if ($(e.target).hasClass('fancyboxModal') == false) {
                e.stopPropagation();
            }
        });
        $('body').click(function(){
            $('.mobile-menu').removeClass('open');
            $('.menu-button').removeClass('active');
        });
        
        
        $('.mobile-menu li > ul').before('<span class="dropdown-button"></span>');
        

        
        $('.mobile-menu .dropdown-button').click(function(){
            $(this).toggleClass('active');
            if($(this).siblings('ul').is(':visible')){
                $(this).siblings('ul').slideUp();
            }else{
                $(this).siblings('ul').slideDown();
            }
            
        });
        
        
        // retina magic
        
            if (window.devicePixelRatio > 1) {
                var lowresImages = $('img.retina');
            
                lowresImages.each(function(i) {
                  var lowres = $(this).attr('src');
                  var highres = lowres.replace(".", "_2x.");
                  $(this).attr('src', highres);
                });
              }
        
        // end retina
        
    
        var panel=$('.top-bar-wrapper'),
        pos=panel.offset().top;
        
        
        function fixedBar(){
            panel.removeClass('fixed');
            pos=panel.offset().top;
            if($(this).scrollTop() > pos && !panel.hasClass('fixed')){
                
                panel.addClass('fixed');
                
            }else if($(this).scrollTop() < pos && panel.hasClass('fixed')){  
                
                panel.removeClass('fixed');  
                
            }
        }
        
        fixedBar();
        
        window.addEventListener("resize", function() {
        	fixedBar();
        }, false);
    
    
        window.addEventListener("orientationchange", function() {
            fixedBar();
        }, false);

        $(window).scroll(function(){
            fixedBar();
        });
        
        
        if ( !$("html").hasClass("touch") ){
            
            if ( !$("body").hasClass("no-animate") ){
                $('.feedback-section .container, .team-section .container, .about-section .inner > .row, .news-section .container, .hit-section .container, .hit-section .container .element').addClass("hidden");
                
                
                
                $('.feedback-section .container').viewportChecker({
                    offset: 400,
                    callbackFunction: function(){
                        $('.feedback-section .container').addClass("visible animated fadeInUp");
                        
                    }
                });
                
                $('.team-section .container').viewportChecker({
                    offset: 400,
                    callbackFunction: function(){
                        $('.team-section .container').addClass("visible animated fadeIn");
                        
                    }
                });
                
                $('.about-section .inner').viewportChecker({
                    offset: 400,
                    callbackFunction: function(){
                        $('.about-section .inner > .row').addClass("visible animated fadeIn");
                    }
                });
                
                $('.news-section .container').viewportChecker({
                    classToAdd: 'visible animated fadeIn',
                    offset: 400
                });
                
                $('.hit-section .container').viewportChecker({
                    classToAdd: 'visible animated fadeIn',
                    offset: 400,
                    callbackFunction: function(){
                        $('.hit-section .container .element').addClass("visible animated fadeInUp");
                    }
                });
            }
        }
        
        $('.mobile-menu li a').click(function(){
            $('.mobile-menu').removeClass('open');
            $('.menu-button.active').removeClass('active');
        });
        
        
        // ASIDE MENU
        $('.aside-menu > ul li.down > ul').before('<span class="dropdown-button"></span>');
        $('.aside-menu .down .dropdown-button').each(function(){
            if($(this).siblings('ul').is(':visible')){
                $(this).addClass('active');
            }
        });
        $('.aside-menu .down .dropdown-button').click(function(){
            $(this).parent().toggleClass('open');
            if($(this).siblings('ul').is(':visible')){
                $(this).siblings('ul').slideUp();
                $(this).removeClass('active');
            }else{
                $(this).siblings('ul').slideDown();
                $(this).addClass('active');
            }
        });
        $('.aside-menu-title').click(function(){
            $('.aside-menu').toggleClass('active');
        });
        // ASIDE MENU END
        
        // ACCORDEON
        var $thisElement, 
            $thisElementContent,
            $elements,
            $elementsContent;
            
        $('.accordeon .title').click(function(){
            $thisElement = $(this).parent();
            $thisElementContent = $thisElement.find('.element-content');
            $elements = $thisElement.siblings();
            $elementsContent = $elements.find('.element-content');
            
            $elements.removeClass('active');
            $elementsContent.slideUp();
            if(!$thisElement.hasClass('active')){
                $thisElement.addClass('active');
                $thisElementContent.slideDown();
            }else{
                $thisElement.removeClass('active');
                $thisElementContent.slideUp();
            }
            
        });
        // /. ACCORDEON
        
        
});// end ready